import React from 'react';
import ContactCard from './ContactCard';
import photo1 from './photo1.jpg';
import photo2 from './photo2.jpg';

function App(){
  return (
    <div>
        <ContactCard 
            name="Heshan"
            imgurl={photo1}
            phone="(94)766209516"
            email="heshansandeepa94@gmail.com"
        />

        <ContactCard 
            name="Mike"
            imgurl="./photo2.jpg"
            phone="(94)766207894"
            email="mike@gmail.com"
        />
    </div>
  );

}

export default App;











